%[text] ## Visualizing Quantum States
%[text]     In this lab we develop the tools that allows an intuitive visualisation of the time-dependent solutions to the quantum harmonic oscillator in phase space. 
%%
%[text] ### Modal Decomposition Tools
%[text]     We start with the analytic solutions to the definite-energy eigenvalue problem, and describe initial conditions as linear combinations of that complete basis.
%[text]     Let $\\beta =\\sqrt{\\frac{1}{2\\hbar \\;}}${"editStyle":"visual"}, and $\\gamma =\\sqrt{2m\\omega \\;}${"editStyle":"visual"}. All lengths are described in the dimensionless multliples of $z\_0 \\;={\\left\\lbrack z\_0^{-1} \\right\\rbrack }\_{\\mathrm{SI}} z\_0 \\;\\mathrm{m}={\\left\\lbrack \\beta \\gamma \\right\\rbrack }\_{\\mathrm{SI}} {\\left(\\beta \\gamma \\;\\right)}^{-1} \\mathrm{m}=\\sqrt{\\frac{\\hbar }{m\\omega }},${"editStyle":"visual"} so that a length of 1 represents $z\_0${"editStyle":"visual"}. All quantities of time are represented in units of ${\\;\\left\\lbrack \\gamma^2 \\right\\rbrack }\_{\\textrm{SI}}^2 \\;\\gamma^{-2} \\mathrm{s}={\\left(m\\omega \\right)}^{-1} \\;\\frac{{\\textrm{kg}}^2 }{2s},${"editStyle":"visual"} where ${\\left\\lbrack \\cdot \\right\\rbrack }\_{\\textrm{SI}}${"editStyle":"visual"} denotes the SI units of the enclosed physical quantity. Note that momentum in these units is also dimensionless, described in units of ${\\left\\lbrack \\beta \\gamma^{-1} \\right\\rbrack }\_{\\textrm{SI}}^2 \\beta^{-1} \\gamma \\;\\textrm{kg}\\;\\frac{\\mathrm{m}}{\\mathrm{s}}=2\\sqrt{\\hbar m\\omega }{\\textrm{kg}}^{-1} \\frac{\\mathrm{s}}{\\mathrm{m}}${"editStyle":"visual"}, so that $\\hbar =\\frac{1}{2}${"editStyle":"visual"} (dimensionless). Then the $j^{\\textrm{th}}${"editStyle":"visual"} solution to the simple harmonic oscillator is given by $\\psi\_j \\left(z\\right)={\\mathcal{N}}\_j H\\left(z\\right)\\;\\exp \\left(-z^2 /2\\right)${"editStyle":"visual"} where ${\\mathcal{N}}\_{j\\;}${"editStyle":"visual"} is a normalization constant. 
%[text] We can plot the first few solutions as follows
plotmax=8;gridmax=1.5*plotmax;dz=.1; firstn=20;
zgrid=-gridmax:dz:gridmax;zgrid=zgrid-zgrid(floor(length(zgrid)/2)+1);
shomodes=zeros(firstn,length(zgrid)); norms=zeros(firstn,1);
for i=1:firstn
    [shomodes(i,:), norms(i)]=SHOmode(zgrid,i-1);end
%%
%Plotting the firstn sho eigensolutions
fig=figure(1); %[output:2923ff3b]
plot(zgrid,shomodes,"DisplayName","shomodes"); %[output:2923ff3b]
title("first "+int2str(firstn)+" SHO modes"); %[output:2923ff3b]
xlim([-plotmax,plotmax]);  %[output:2923ff3b]
if firstn<=5
    legend("Location","northwest");
    legend('boxoff'); end
xlabel("z (in units of z_0 m^{-1})"); ylabel("\psi(x)") %[output:2923ff3b]
%%
%[text] We now decompose a displaced groundstate into the first n modes to evolve it
firstncoh=8; firstnsqueezed=12;
cohstate=SHOmode(zgrid-2,0);
squeezedstate=sqrt(2)*SHOmode(2*zgrid,0); getcoeffs=@(state,firstn)gridint(zgrid,state.*shomodes(1:firstn,:)'.');
coeffssqueezed=getcoeffs(squeezedstate,firstnsqueezed);coeffscoh=getcoeffs(cohstate,firstncoh);
coh_reconstruction=coeffscoh*shomodes(1:firstncoh,:);
squeezed_reconstruction=coeffssqueezed*shomodes(1:firstnsqueezed,:);
%%
names=["coherent","squeezed"]; plots={[cohstate;coh_reconstruction],[squeezedstate;squeezed_reconstruction]};
Ms=[firstncoh,firstnsqueezed]; plotmaxes=[1.5,1/2]; coeffs={coeffscoh,coeffssqueezed};
for i=1:2 %[output:group:1e2c7c5a]
    figure() %[output:386bf162] %[output:14319cf9]
    plot(zgrid,cell2mat(plots(i))); %[output:386bf162] %[output:14319cf9]
    title({"initial "+names(i)+" state","and its reconstruction"});
    xlim(plotmaxes(i)*[-plotmax,plotmax]); legend(["true","copy"],"Location","northwest"); legend('boxoff');
    xlabel("z (in units of z_0 m^{-1})"); ylabel("\psi(x)");
    disp("coeffs norm: "+num2str(norm(cell2mat(coeffs(i))))); %[output:6821c1f4] %[output:006fe48b]
    disp("M: "+int2str(Ms(i)));end %[output:group:1e2c7c5a] %[output:189ca31b] %[output:1b457bf5]
%%
%[text] ### Expectation Values
%[text]     In order to check the satisfaction of the Heisenberg uncertainty principle, we need a way to evaluate expectation values (to obtain position and momentum variances)
%Code to calculate expectation values
getmoment=@(psi,grid,n)gridint(grid,grid.^n.*abs(psi).^2);
pmax=pi/(2*dz);pgrid=linspace(-pmax,pmax,length(zgrid));pgrid=pgrid-pgrid(floor(length(zgrid)/2)+1);
dp=2*pmax/(length(zgrid)-1);
ffttop=@(psix)dz/sqrt(pi)*fftshift(fft(ifftshift(psix)));
iffttox=@(psip)dp*length(psip)/sqrt(pi)*fftshift(ifft(ifftshift(psip)));
sho0inp=ffttop(shomodes(1,:));
disp("check fft/ifft def: total probability after fft= "+num2str(gridint(pgrid,abs(sho0inp).^2))); %[output:66ffc68d]
% plot(pgrid,sho0inp);xlim([-plotmax,plotmax]) %Plot for further verification of correct fft/ifft definitionsh
[states,ns]=meshgrid({shomodes(1,:),squeezedstate},{1,2});
momentsx=num2cell(cellfun(@(state,n)getmoment(state,zgrid,n),states,ns));[cohmeanx,cohmeanx2,sqmeanx,sqmeanx2]=momentsx{:};
cohstdx=sqrt(cohmeanx2-cohmeanx^2);sqstdx=sqrt(sqmeanx2-sqmeanx^2);
momentsp=num2cell(cellfun(@(state,n)getmoment(ffttop(state),pgrid,n),states,ns));[cohmeanp,cohmeanp2,sqmeanp,sqmeanp2]=momentsp{:};
cohstdp=sqrt(cohmeanp2-cohmeanp^2);sqstdp=sqrt(sqmeanp2-sqmeanp^2);
[statenames,quads]=meshgrid({'coherent','squeezed'},{'x','p'});units=["\sqrt{\hbar/(m \omega)} m^{-1}"; "2 \sqrt{\hbar m \omega} kg^{-1} s/m"];
cellfun(@(name,quad,val,unit)... %[output:group:37504986] %[output:9989a5c1]
    disp("numerical "+quad+"-std for "+name+" state: "+num2str(val)+" "+unit),statenames,quads,{cohstdx,sqstdx;cohstdp,sqstdp},num2cell([units,units])); %[output:group:37504986] %[output:9989a5c1]
disp("These match the exact values, giving the minimum uncertainty products (p-std)*(x-std)=hbar/2=1/4="+num2str(sqstdx*sqstdp)) %[output:481cc6c9]
%%
%[text] ### Evolution of coherent and squeezed states
dwt=pi/32;wtgrid=[0:dwt:6*pi]; %Defining the omega-temporal grid
plotmaxindex=@(pm)floor(length(zgrid)/2)+1+pm*ceil(plotmax/dz); %index corresponding to position values plotmax
plotgridindices=plotmaxindex(-1):plotmaxindex(1);plotgrid=zgrid(plotgridindices); %subset of the full zgrid to show plot
getmovie=@(coeffs)coeffs.*exp(-1i*wtgrid'*(1/2+[0:length(coeffs)-1]))*shomodes(1:length(coeffs),:);
movies=cellfun(getmovie,{coeffscoh,coeffssqueezed},'UniformOutput',false);[cohmovie,sqmovie]=movies{:};
%%
%Plottig the evolution
[movs,names]=meshgrid({cohmovie,sqmovie},{'Coherent','Squeezed'});
% cellfun(@(mov,name)...
    imagesc(wtgrid,plotgrid,abs(cohmovie(:,plotgridindices).').^2);colorbar;title("Coherent"+" state evolution: |\Psi(z,t)|^2");xlabel("\omega{t}");ylabel("z (in units of z_0 m^{-1})")%,movs,names) %[output:0f85a404]
    imagesc(wtgrid,plotgrid,abs(sqmovie(:,plotgridindices).').^2);colorbar;title("Squeezed"+" state evolution: |\Psi(z,t)|^2");xlabel("\omega{t}");ylabel("z (in units of z_0 m^{-1})") %[output:98276c97]
%%
%[text]     The Shrodinger evolution can also be visualized in the momentum-basis, by converting each time frame into the momentum representation. The following is the code that does this, in addition to evaluating the uncertainy product at each time step.
pplotmax=8/sqrt(2);pplotmaxindex=@(pm)floor(length(pgrid)/2)+1+pm*ceil(pplotmax/dp);pplotgridindices=pplotmaxindex(-1):pplotmaxindex(1);
cohmovie_p=zeros(size(cohmovie,1),length(pplotgridindices));cohframe=cohstate; cohstdmov=zeros(2,size(cohmovie,1));%stds of position (row 1) and momentum (row2) as a function of time
sqmovie_p=zeros(size(cohmovie_p));sqframe=squeezedstate; sqstdmov=zeros(2,size(sqmovie,1));
for i=1:length(wtgrid)
    %Coherent state momentum update
    cohframe(plotgridindices)=cohmovie(i,plotgridindices);
    cohframep=ffttop(cohframe);
    cohmovie_p(i,:)=cohframep(pplotgridindices);
    %Squeezed state momentum update
    sqframe(plotgridindices)=sqmovie(i,plotgridindices);
    sqframep=ffttop(sqframe);
    sqmovie_p(i,:)=sqframep(pplotgridindices);
end

momentsxmov=cellfun(@(state,n)getmoment(state(:,plotgridindices),plotgrid,n),movs,ns,"UniformOutput",false);[cohmeanmovx,cohmeanmovx2,sqmeanmovx,sqmeanmovx2]=momentsxmov{:};
cohstdmov(1,:)=sqrt(cohmeanmovx2-cohmeanmovx.^2);sqstdmov(1,:)=sqrt(sqmeanmovx2-sqmeanmovx.^2);
pmovs=meshgrid({cohmovie_p,sqmovie_p},{1,2}); plotpgrid=pgrid(pplotgridindices);
momentspmov=cellfun(@(state,n)getmoment(state,plotpgrid,n),pmovs,ns,"UniformOutput",false);[cohmeanmovp,cohmeanmovp2,sqmeanmovp,sqmeanmovp2]=momentspmov{:};
cohstdmov(2,:)=sqrt(cohmeanmovp2-cohmeanmovp.^2);sqstdmov(2,:)=sqrt(sqmeanmovp2-sqmeanmovp.^2);
disp("total momentum probabilities: "+num2str(gridint(plotpgrid,abs(cohmovie_p).^2)))%Sanity check for correct momentum evolution %[output:2d3376dc]
%%
%Plotting the momentum-representation of the state evolutions
imagesc(wtgrid,plotpgrid,abs(cohmovie_p.').^2);colorbar;title("Coherent"+" state evolution: |\Phi(z,t)|^2");xlabel("wt");ylabel({"p (in custom units)"}); %[output:904a4064]
imagesc(wtgrid,plotpgrid,abs(sqmovie_p.').^2);colorbar;title("Squeezed"+" state evolution: |\Phi(z,t)|^2");xlabel("wt");ylabel({"p (in custom units)"}); %[output:66d06ff6]
%%
%Plotting the uncertainty product as a function of time
plot(wtgrid,[prod(cohstdmov);prod(sqstdmov)]); %[output:6b4ed9d8]
title({"Uncertainty products of squuezed and","coherent states of a SHO evolving over time"}); %[output:6b4ed9d8]
xlabel("\omega{t}");ylabel("\sigma_x*\sigma_p");legend({"coherent","squeezed"}) %[output:6b4ed9d8]
%[text]     The minimum uncertainty product is not maintained for the squeezed state. According to the uncertainty product plot, the times at which it is attained correspond to times when the momentum or the position is most confined.
%[text]     From the plots of the states in the position and momentum representations, it is clear that the squeezed state has a frequency that is twice that of the coherent state. This indicates that the squeezed state is more symmetric than the coherent state.
%%
%[text] ## Wigner Function picture
%[text]     The wigner function associated with a density matrix $\\hat{\\rho \\;}${"editStyle":"visual"}in the choice of units described in section 1 is given by $W\\left(z,p\\right)=\\frac{2}{\\pi }\\int\_{-\\infty \\;}^{\\infty \\;} \\langle z-u|\\;\\hat{\\rho} \\;|z+u\\rangle \\;e^{4\\textrm{iup}} \\textrm{du}${"editStyle":"visual"}, which can be evaluated numerically by
[Wsq,modzgrid,modpgrid]=W(squeezedstate,dz);
Wcoh=W(cohstate,dz);
py=gridint(modzgrid,Wsq);
disp("Sanity check: integral of W = "+num2str(gridint(modpgrid,py))); %[output:5d4b77fd]
%%
%Numerical Sanity check that the Weyl transform is correct.
wignerprobx=gridint(modpgrid,Wsq.');
wignerprobp=gridint(modzgrid,Wsq);
disp("wigner x^2 moment: "+num2str(gridint(modzgrid,modzgrid.^2.*wignerprobx))); %[output:981f34cf]
disp("psi x^2 moment: "+num2str(sqmeanx2)); %[output:2b09b7e4]
disp("wigner p^2 moment: "+num2str(gridint(modpgrid,modpgrid.^2.*wignerprobp))); %[output:73db1b44]
disp("psi p^2 moment: "+num2str(sqmeanp2)); %[output:3dc5b433]
%%
%visual sanity check
plot(modzgrid,wignerprobx);hold on; %[output:0fd4cb12]
plot(zgrid,abs(squeezedstate).^2); %[output:0fd4cb12]
title("\int_{-\infty}^{\infty} W(z,p) dp overlayed with |\Psi(z)|^2"); %[output:0fd4cb12]
xlabel("z (in units of z_0)");ylabel("p (in modified units)"); %[output:0fd4cb12]
xlim([-plotmax,plotmax]);hold off %[output:0fd4cb12]

sqstate_p=sqmovie_p(1,:);
plot(modpgrid,wignerprobp);hold on; %[output:068c4abc]
plot(pgrid(pplotgridindices),abs(sqstate_p).^2);xlim([-pplotmax,pplotmax]); %[output:068c4abc]
xlabel("z (in units of z_0)");ylabel("p (in modified units)") %[output:068c4abc]
title("\int_{-\infty}^{\infty} W(z,p) dz overlayed with |\Phi(p)|^2");hold off %[output:068c4abc]
%%
imagesc(modzgrid,modpgrid,Wsq);colorbar;title("W(z,p) for squeezed state"); %[output:4223b1d8]
xlabel("z (in units of z_0)");ylabel("p (in modified units)"); %[output:4223b1d8]
daspect([1,1,1]) %[output:4223b1d8]
imagesc(modzgrid,modpgrid,Wcoh);colorbar;title("W(z,p) for coherent state"); %[output:7448b31e]
xlabel("z (in units of z_0)");ylabel("p (in modified units)");daspect([1,1,1]); %[output:7448b31e]
%%
%[text]     The Wigner function of the number state 1 has negative values near the origin.
Wsho1=W(shomodes(2,:),dz);
imagesc(modzgrid,modpgrid,Wsho1);colorbar;title("W(z,p) for first excited SHO state"); %[output:70c11c13]
xlabel("z (in units of z_0)");ylabel("p (in modified units)");daspect([1,1,1]); %[output:70c11c13]
%%
%[text]     How does the Wigner function of the coherent state evolve over time?
nframes=30 %[output:22202a99]
Wcohmovdata=zeros(size(cohmovie,2),size(cohmovie,2)-2,nframes);
for i=1:nframes
    Wcohmovdata(:,:,i)=W(cohmovie(i*floor(length(wtgrid)/nframes),:),dz);end
%%
%Encoding the movie into an mp4. Open the file wignercohmov.mp4 created in
%the directory of this code file after running this section.
wignercohmov=VideoWriter("wignercohmov.mp4","MPEG-4");
wignercohmov.FrameRate=floor(nframes/3);
open(wignercohmov);
for f=1:nframes %[output:group:86ddcc3e]
    imagesc(modzgrid,modpgrid,Wcohmovdata(:,:,f));daspect([1,1,1]);colorbar; %[output:2d358c20]
    title("W(z,p) for coherent state");text(11.5,9.5,"wt="+num2str(wtgrid(floor(f*length(wtgrid)/nframes))));
    xlabel("z (in units of z_0)");ylabel("p (in modified units)");
    writeVideo(wignercohmov,getframe(gcf));end;close(wignercohmov); %[output:group:86ddcc3e] %[output:2d358c20]
%%
%Evolution of the position and momentum means of the SHO coherent state
wignercohmeanmov=zeros(2,nframes);
for t=1:nframes
    wignercohmeanmov(1,t)=gridint(modpgrid,gridint(modzgrid,modzgrid.*Wcohmovdata(:,:,t)));
    wignercohmeanmov(2,t)=gridint(modpgrid,modpgrid.*gridint(modzgrid,Wcohmovdata(:,:,t)));end
%%
plot(wignercohmeanmov(1,:),wignercohmeanmov(2,:)); %[output:4dec9ad0]
title("Phase space evolution of the coherent state mean"); %[output:4dec9ad0]
xlabel("z (in units of z_0)");ylabel("p (in modified units)"); %[output:4dec9ad0]
%%
%[text]     Evolution of the Wigner funciton of a squeezed coherent state in the Wigner function picture 
cohsqstate=arrayfun(@(z)sqrt(sqrt(4/pi))*exp(-(2*(z-2))^2/2),zgrid);
cohsqcoeffs=gridint(zgrid,cohsqstate.*shomodes(1:firstnsqueezed,:)'.');
wtgridmp4=2*pi/nframes*[0:nframes-1];
cohsqstatemov=cohsqcoeffs.*exp(-1i*wtgridmp4.'*(1/2+[1:firstnsqueezed]))*shomodes(1:firstnsqueezed,:);
disp("Integral of state: "+num2str(gridint(zgrid,abs(cohsqstate).^2))); %[output:37922199]
%%
imagesc(wtgridmp4,plotgrid,abs(cohsqstatemov(:,plotgridindices).').^2);colorbar; %[output:5ddaf97d]
title({"position probability evolution","of squeezed displaced state"}); %[output:5ddaf97d]
xlabel("\omega{t}");ylabel("z (in units of z_0)"); %[output:5ddaf97d]
%%
%Wigner state picture of the evolution as an mp4. Open the file wignercohsqmov.mp4 created in
%the directory of this code file after running this section.
wigneranhocohmov=VideoWriter("wignercohsqmov.mp4","MPEG-4");
wigneranhocohmov.FrameRate=floor(nframes/3);
open(wigneranhocohmov);
for f=1:nframes %[output:group:73bf16e2]
    imagesc(modzgrid,modpgrid,W(cohsqstatemov(f,:),dz));daspect([1,1,1]);colorbar; %[output:8e97543e]
    title("W(z,p) for displaced squeezed state");text(11.5,9.5,"\omega{t}="+num2str(wtgridmp4(f)));
    xlabel("z (in units of z_0)");ylabel("p (in modified units)");
    writeVideo(wigneranhocohmov,getframe(gcf));end;close(wigneranhocohmov); %[output:group:73bf16e2]
%[text]     The evolution of the quantum state is a rotation around the origin in phase space. A displacement and squeezin in z becomes a displacement and squeezing of p at $\\omega t=n\\frac{\\pi }{2}${"editStyle":"visual"} where $n\\in \\mathbb{Z}\\ldotp${"editStyle":"visual"} The state has mean 0 and displays antisqueezing at these times.
%%
%[text]     Evolution of a displaced Gaussian state in an anharmonic oscillator potential. Start by defining the discretized Hamiltonian ${\\left(H\_{\\textrm{ij}} \\right)}\_{\\textrm{ij}}${"editStyle":"visual"} satisfying $\\vec{\\psi} \\left(t\\right)=e^{-i\\omega \\textrm{tH}} \\vec{\\psi} \\left(0\\right)\\ldotp${"editStyle":"visual"}
symize=@(M)(M+M');
hmat=diag((1/dz)^2+1/2*zgrid.^2)-(1/dz)^2/2*symize([zeros(length(zgrid)-1,1) eye(length(zgrid)-1);zeros(1,length(zgrid))]);
hmat_anho=hmat+0.02*diag(zgrid.^4);
%%
[anhovecs,anhovalmat]=eigs(hmat_anho,firstncoh,'smallestabs');
firstnanhovals=diag(anhovalmat);
anhovecnorms=arrayfun(@(v)sqrt(gridint(zgrid,abs(v{:}.').^2)),num2cell(anhovecs,1));
normalized_anhovecs=anhovecs./anhovecnorms;
coeffsanhocoh=gridint(zgrid,cohstate.*normalized_anhovecs');
wtanhogrid=[0:.5:250];
anhocohmovie=coeffsanhocoh.*exp(-1i*wtanhogrid.'*firstnanhovals.')*normalized_anhovecs.';
%%
%Evaluating the evolution of means through phase-space.
anhocohmeanmov=[gridint(zgrid,zgrid.*abs(anhocohmovie).^2);gridint(pgrid,pgrid.*abs(ffttop(anhocohmovie.').').^2)];
%%
%Plotting just the mean of the position
plot(wtanhogrid,anhocohmeanmov(1,:));xlabel("\omega{t}");ylabel("\langle{z} (in units of z_0)"); %[output:81c1822c]
title({"Mean position of a n initially displaced","particle evolving in a quantum anharmonic oscillator"}) %[output:81c1822c]
%%
plot(anhocohmeanmov(1,1:101),anhocohmeanmov(2,1:101)); %[output:513bdc66]
title({"Evolution of the mean of a displaced gaussian","state through phase space for a", "quantum anharmonic oscillator (\omega{t}\in[0,50])"}); %[output:513bdc66]
xlabel("\langle{z}\rangle (in units of z_0)");ylabel("\langle{p}\rangle (in modified units)"); %[output:513bdc66]
%%
%[text]     The Wigner function of the "dissipated" state has negative values
imagesc(modzgrid,modpgrid,W(anhocohmovie(101,:),dz));colorbar;daspect([1,1,1]); %[output:0569a4d5]
title({"W(z,p) for a displaced gaussian state","evolved by a quantum anharmonic oscillator","to a maximally dissipated state (\omega{t}=50)"}); %[output:0569a4d5]
xlabel("z (in units of z_0 m^{-1})");ylabel("p (in modified units)"); %[output:0569a4d5]
%%
%[text]     The Wigner function of the evolved state at the time of revival resemles its inital form
imagesc(modzgrid,modpgrid,W(anhocohmovie(310,:),dz));colorbar;daspect([1,1,1]); %[output:2673e143]
title({"W(z,p) for a displaced gaussian state","evolved by a quantum anharmonic oscillator","after dissipating and reviving (\omega{t}=154)"}); %[output:2673e143]
xlabel("z (in units of z_0 m^{-1})");ylabel("p (in modified units)"); %[output:2673e143]
